from datetime import datetime, timedelta
import os

class Submission:
    def __init__(self, title, status, date_submitted, file_path):
        self.title = title
        self.status = status
        self.date_submitted = date_submitted
        self.file_path = file_path

    def validate_submission(self):
        return bool(self.title and self.status and self.file_path and os.path.isfile(self.file_path))

class SubmissionManager:
    def __init__(self):
        self.submissions = []
        self.log = []

    def submit_record(self, title, status, file_path):
        if not self.validate_file_format(file_path):
            raise ValueError("Invalid file format!")
        date_submitted = datetime.now()
        new_submission = Submission(title, status, date_submitted, file_path)
        if new_submission.validate_submission():
            self.submissions.append(new_submission)
            self.log_event(f"Submitted record: {title}")
        else:
            raise ValueError("Submission validation failed.")

    def update_submission_status(self, title, new_status):
        for submission in self.submissions:
            if submission.title == title:
                submission.status = new_status
                self.log_event(f"Updated status of: {title} to {new_status}")
                return
        raise ValueError("Submission not found.")

    def process_deletions(self, days):
        cutoff_date = datetime.now() - timedelta(days=days)
        self.submissions = [s for s in self.submissions if s.date_submitted > cutoff_date]
        self.log_event(f"Processed deletions older than {cutoff_date.date()}")

    def validate_file_format(self, file_path):
        allowed_extensions = ['.txt', '.pdf', '.docx']
        return any(file_path.endswith(ext) for ext in allowed_extensions)

    def download_file(self, title):
        for submission in self.submissions:
            if submission.title == title:
                return submission.file_path
        raise ValueError("Submission not found for download.")

    def log_event(self, message):
        timestamp = datetime.now().strftime("%Y-%m-%d %H:%M:%S")
        self.log.append(f"{timestamp}: {message}")

    def prevent_double_publishing(self, title):
        if any(sub.title == title for sub in self.submissions):
            raise ValueError("Duplicate submission detected!")

